function ZoekPlaatje(gencode, geslacht, diersoort){
			Kleurenlijst = LeesKleurenlijst("EN", diersoort);
				for(e=0;e<Kleurenlijst.length;e++){
					if (gencode == Kleurenlijst[e][0] ){

						if (geslacht == "M"){
							return Kleurenlijst[e][3];
						} else {
							return Kleurenlijst[e][4];
						}
					}
				}
			return "";
}

